import{_ as o}from"./folding.6d09f8df.js";import{_ as t,o as l,c as a,f as e}from"./app.87197fef.js";const d={},n=e('<h3 id="folding" tabindex="-1"><a class="header-anchor" href="#folding" aria-hidden="true">#</a> Folding</h3><p>If you want to see an overview of the structure of the code file you&#39;re working on, folding can be a helpful tool. Folding hides blocks of code such as functions or looping blocks in order to simplify what is on your screen.</p><p>You can fold blocks of code by clicking the arrows that appear when you hover your mouse cursor over the gutter. You can also fold and unfold from the keyboard with the <kbd class="platform-mac">Alt+Cmd+[</kbd><kbd class="platform-windows platform-linux">Alt+Ctrl+[</kbd> and <kbd class="platform-mac">Alt+Cmd+]</kbd><kbd class="platform-windows platform-linux">Alt+Ctrl+]</kbd> keybindings.</p><p><img src="'+o+'" alt="Code folding example" title="Code folding example"></p><p>To fold everything, use <kbd class="platform-mac">Alt+Cmd+Shift+[</kbd><kbd class="platform-windows platform-linux">Alt+Ctrl+Shift+[</kbd> and to unfold everything use <kbd class="platform-mac">Alt+Cmd+Shift+]</kbd><kbd class="platform-windows platform-linux">Alt+Ctrl+Shift+]</kbd>. You can also fold at a specific indentation level with <kbd class="platform-mac">Cmd+K</kbd><kbd class="platform-windows platform-linux">Ctrl+K</kbd> <kbd class="platform-mac">Cmd+0-9</kbd><kbd class="platform-windows platform-linux">Ctrl+0-9</kbd> where the number is the indentation depth.</p><p>Finally, you can fold arbitrary sections of your code or text by making a selection and then typing <kbd class="platform-mac">Alt+Cmd+Ctrl+F</kbd><kbd class="platform-windows platform-linux">Alt+Ctrl+F</kbd> or choosing &quot;Fold Selection&quot; in the Command Palette.</p>',6),r=[n];function s(i,c){return l(),a("div",null,r)}const p=t(d,[["render",s],["__file","folding.html.vue"]]);export{p as default};
